<!DOCTYPE html>

<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
    let a =[7,2,5,3,5,3,4,8,5];
    let b=[7,2,5,4,6,3,5,3,3] ;
    for (let i = 0; i <b.length ; i++) {
        for (let j = 0; j <a.length ; j++) {
            if(b[i]==a[j]){
                a.splice(j,1);
                b.splice(i,1);
                i--;
            }
        }
    }
    alert(b);


</script>
